%[text] # S3 | Sistemas
%%
%[text] ## Sistemas
%[text] ![](text:image:3553)
%[text] ![](text:image:8b1f)
syms t

x = t*cos(2*pi*t) %[output:48eb2771]
y = subs(x,t,t-2) %[output:76538086]
T = [0 3];

subplot(2,1,1) %[output:4879d85c]
fplot(x,T) %[output:4879d85c]
grid on %[output:4879d85c]
legend("x(t)") %[output:4879d85c]
subplot(2,1,2) %[output:4879d85c]
fplot(y,T,'r') %[output:4879d85c]
grid on %[output:4879d85c]
legend("y(t)") %[output:4879d85c]
%[text] ![](text:image:2a0c)
syms t

x1 = heaviside(t)-heaviside(t-3) %[output:1c3f19f3]
x2 = t*sin(t) %[output:472ef0ed]
x3 = t*cos(t) %[output:03b01e19]

y = x1+x2*x3 %[output:12d336e7]
T = [0 4];

subplot(2,1,1) %[output:4879d85c]
fplot(x1,T) %[output:4879d85c]
hold on %[output:4879d85c]
fplot(x2,T) %[output:4879d85c]
fplot(x3,T) %[output:4879d85c]
hold off %[output:4879d85c]
grid on %[output:4879d85c]
legend("x_{1}(t)","x_{2}(t)","x_{3}(t)") %[output:4879d85c]


subplot(2,1,2) %[output:4879d85c]
fplot(y,T,'r') %[output:4879d85c]
grid on %[output:4879d85c]
legend("y(t)") %[output:4879d85c]


%[text] ![](text:image:21b1)
syms  t 

x1 = heaviside(t) %[output:6121c880]
x2 = 0.5*heaviside(t-1) %[output:1914528f]

y1 = x1+x2 %[output:5b30898e]
y2 = x1-x2 %[output:692188c5]

T = [-2 2];

subplot(2,1,1) %[output:4879d85c]
fplot(x1,T) %[output:4879d85c]
hold on %[output:4879d85c]
fplot(x2,T) %[output:4879d85c]
hold off %[output:4879d85c]
grid on %[output:4879d85c]
legend("x_{1}(t)","x_{2}(t)") %[output:4879d85c]


subplot(2,1,2) %[output:4879d85c]
fplot(y1,T,'.-') %[output:4879d85c]
hold on %[output:4879d85c]
fplot(y2,T,'--') %[output:4879d85c]
hold off %[output:4879d85c]
grid on %[output:4879d85c]
legend("y_{1}(t)","y_{2}(t)") %[output:4879d85c]

%%
%[text] ## Propiedades
%[text] **Causalidad**
%[text] ![](text:image:7100)
syms t

x = heaviside(t) - heaviside(t-1) %[output:8ae8017e]
T = [-1 3];
Y = [-1 3];

figure %[output:6efdcbbc]
fplot(x,T) %[output:6efdcbbc]
ylim(Y) %[output:6efdcbbc]

%[text] La señal de entrada $x\\left(t\\right)${"editStyle":"visual"} es un pulso cuadrado, que inicia en cero y termina en uno. Si el sistema es causal, esperaría que......; por otra parte, si el sistema no es causal, esperaría que....
y1 = subs(x,t,t+1) %[output:2b4ba014]
y2 = subs(x,t,t-1) %[output:7a763439]

T = [-3 3] %[output:00add74d]
Y = [-1 3] %[output:8d6d120a]

figure %[output:1558a23a]
subplot(2,1,1) %[output:1558a23a]
fplot(x,T) %[output:1558a23a]
ylim(Y) %[output:1558a23a]
legend("x(t)") %[output:1558a23a]
subplot(2,1,2) %[output:1558a23a]
fplot(y1,T,'k') %[output:1558a23a]
hold on %[output:1558a23a]
fplot(y2,T,'g') %[output:1558a23a]
hold off %[output:1558a23a]
legend("y_{1}","y_{2}") %[output:1558a23a]
ylim(Y) %[output:1558a23a]

%[text] El sistema $y\_1 \\left(t\\right)${"editStyle":"visual"} **no es causal** porque la respuesta comienza antes de que aparezca la señal de entrada $x\\left(t\\right)${"editStyle":"visual"}. Por otra parte, $y\_{2\\;} \\left(t\\right)${"editStyle":"visual"} **es causal** porque la respuesta comienza después de que aparezca la señal de entrada $x\\left(t\\right)${"editStyle":"visual"}. 
%[text] ![](text:image:6c09)
%[text] **Memoria**
%[text] ![](text:image:07d9)
syms t

x = heaviside(t) - heaviside(t-1) %[output:40b57953]
T = [-1 3] %[output:1f5a20e0]
Y = [-1 5] %[output:2e4eb538]

y1 = 3*x %[output:8c487171]
y2 = x+subs(x,t,t-1) %[output:3c128651]

figure %[output:783c17a9]
subplot(2,1,1) %[output:783c17a9]
fplot(x,T) %[output:783c17a9]
ylim(Y) %[output:783c17a9]
legend("x(t)") %[output:783c17a9]
subplot(2,1,2) %[output:783c17a9]
fplot(y1,T,'k') %[output:783c17a9]
hold on %[output:783c17a9]
fplot(y2,T,'g') %[output:783c17a9]
hold off %[output:783c17a9]
legend("y_{1}","y_{2}") %[output:783c17a9]
ylim(Y) %[output:783c17a9]
%[text] El sistema $y\_2 \\left(t\\right)${"editStyle":"visual"} tiene memoria porque *sigue encendido* a pesar de que $x\\left(t\\right)${"editStyle":"visual"} ya se apagó.
%[text] ![](text:image:33db)
%[text] **Linealidad**
%[text] ![](text:image:54ef)
clear

syms t s

a1 = 2;
a2 = 5;

x1 = heaviside(t) - heaviside(t-1) %[output:91dab4e5]
x2 = heaviside(t) - heaviside(t-2) %[output:26f1ab8b]

x_sum = a1*x1 + a2*x2 %[output:46413a2f]


%Primer sistema
y = 2*s %[output:27635fbd]

%Y cerrada
y_c = subs(y,s,x_sum) %[output:34532e92]
%Y abierta
y_a = a1*subs(y,s,x1)+a2*subs(y,s,x2) %[output:44aace4e]


T = [-1 3];
Y = [-1 20];

figure %[output:2169627b]
subplot(2,1,1) %[output:2169627b]
fplot(x_sum,T) %[output:2169627b]
ylim(Y) %[output:2169627b]
legend("a_1x_1+a_2x_2") %[output:2169627b]
subplot(2,1,2) %[output:2169627b]
fplot(y_c,T,'r.-') %[output:2169627b]
hold on %[output:2169627b]
fplot(y_a,T,'g--') %[output:2169627b]
ylim(Y) %[output:2169627b]
hold off %[output:2169627b]
legend("y_c","y_a") %[output:2169627b]



%Segundo sistema
y = s^2 %[output:29177a67]

%Y cerrada
y_c = subs(y,s,x_sum) %[output:23e97868]
%Y abierta
y_a = a1*subs(y,s,x1)+a2*subs(y,s,x2) %[output:54f72fed]


T = [-1 3];
Y = [-1 80];

figure %[output:9bac7c8f]
subplot(2,1,1) %[output:9bac7c8f]
fplot(x_sum,T) %[output:9bac7c8f]
ylim(Y) %[output:9bac7c8f]
legend("a_1x_1+a_2x_2") %[output:9bac7c8f]
subplot(2,1,2) %[output:9bac7c8f]
fplot(y_c,T,'r.-') %[output:9bac7c8f]
hold on %[output:9bac7c8f]
fplot(y_a,T,'g--') %[output:9bac7c8f]
ylim(Y) %[output:9bac7c8f]
hold off %[output:9bac7c8f]
legend("y_c","y_a") %[output:9bac7c8f]
%[text] El sistema $y\_1 \\left(t\\right)${"editStyle":"visual"} **es lineal**, porque el resultado de $y\_1 \\left(a\_1 x\_1 \\left(t\\right)+a\_2 x\_2 \\left(t\\right)\\right)${"editStyle":"visual"} **es igual** a ${a\_1 y}\_1 \\left(x\_1 \\left(t\\right)\\right)+a\_2 y\_1 \\left(x\_2 \\left(t\\right)\\right)${"editStyle":"visual"}, tal como se muestra a continuación.
%[text] ![](text:image:9a55)
%[text] El sistema $y\_2 \\left(t\\right)${"editStyle":"visual"} **no es lineal**, porque el resultado de $y\_2 \\left(a\_1 x\_1 \\left(t\\right)+a\_2 x\_2 \\left(t\\right)\\right)${"editStyle":"visual"} **no es igual** a ${a\_1 y}\_2 \\left(x\_1 \\left(t\\right)\\right)+a\_2 y\_2 \\left(x\_2 \\left(t\\right)\\right)${"editStyle":"visual"}, tal como se muestra a continuación.
%[text] ![](text:image:9466)
%[text] **Invariabilidad temporal**
%[text] ![](text:image:9ce7)
clear 
syms s t

x = heaviside(t) - heaviside(t-5) %[output:03e3d1b2]
y = t*exp(-t)*x %[output:74d81123]

%Tralado en tiempo
t1 = -2;

T = [-4 10];
Y = [-2 2];

%Señal de entrada trasladada en tiempo
x_shifted = subs(x,t,t+t1) %[output:678f3313]
%Salida del sistema alimentada con una señal trasladada en tiempo
y_original = subs(y,x,x_shifted) %[output:9493b7c6]
%Salida del sistema traladado en tiempo, alimentado con señal original
y_shifted = subs(y,t,t+1) %[output:76de2904]


figure %[output:3c7731a7]
subplot(2,1,1) %[output:3c7731a7]
fplot(x,T) %[output:3c7731a7]
hold on %[output:3c7731a7]
fplot(x_shifted,T,'--') %[output:3c7731a7]
hold off %[output:3c7731a7]
ylim(Y) %[output:3c7731a7]
legend("x(t)","x(t+t_1)") %[output:3c7731a7]
subplot(2,1,2) %[output:3c7731a7]
fplot(y_original,T) %[output:3c7731a7]
hold on %[output:3c7731a7]
fplot(y_shifted,T,'--') %[output:3c7731a7]
ylim(Y) %[output:3c7731a7]
hold off %[output:3c7731a7]
legend("y(x(t+t_1),t)","y(x(t),t+t_1)") %[output:3c7731a7]

%[text] El sistema $y\\left(t\\right)${"editStyle":"visual"} **no es invariante en el tiempo** porque (**la forma de) la respuesta del sistema cambia** cuando se alimenta con la señal $x\\left(t\\right)${"editStyle":"visual"} a tiempos distintos
%[text] ![](text:image:1472)
%[text] 
%[text] ![](text:image:1728)
clear 
syms s t

x = cos(t)*(heaviside(t) - heaviside(t-10)) %[output:6406c15f]
y = 1-2*subs(x,t,t-1) %[output:15a63773]

%Tralado en tiempo
t1 = -2;

T = [-2 15];
Y = [-10 10];

%Señal de entrada trasladada en tiempo
x_shifted = subs(x,t,t+t1) %[output:469ac2f9]
%Salida del sistema alimentada con una señal trasladada en tiempo
y_original = subs(y,x,x_shifted) %[output:28e1063f]
%Salida del sistema traladado en tiempo, alimentado con señal original
y_shifted = subs(y,t,t+1) %[output:9d941933]


figure %[output:221a528b]
subplot(2,1,1) %[output:221a528b]
fplot(x,T) %[output:221a528b]
hold on %[output:221a528b]
fplot(x_shifted,T,'--') %[output:221a528b]
hold off %[output:221a528b]
ylim(Y) %[output:221a528b]
legend("x(t)","x(t+t_1)") %[output:221a528b]
subplot(2,1,2) %[output:221a528b]
fplot(y_original,T) %[output:221a528b]
hold on %[output:221a528b]
fplot(y_shifted,T,'--') %[output:221a528b]
ylim(Y) %[output:221a528b]
hold off %[output:221a528b]
legend("y(x(t+t_1),t)","y(x(t),t+t_1)") %[output:221a528b]
%[text] El sistema $y\\left(t\\right)${"editStyle":"visual"} **es invariante en el tiempo** porque (**la forma de) la respuesta del sistema no cambia** cuando se alimenta con la señal $x\\left(t\\right)${"editStyle":"visual"} a tiempos distintos
%[text] ![](text:image:9fce)
%[text] **Invertibilidad**
%[text] ![](text:image:0e1a)
clear 
syms s t

x = 2*t %[output:44a230d7]

y1 = 3*x %[output:5c5b4c8b]
y2 = x^2 %[output:5d9e472e]

T = [-5 5];
Y = [-10 10];

%Despejo calcular "la función inversa"
y1_inv = s/3 %[output:25baa9cf]
y2_inv = sqrt(s) %[output:6e557f9c]

%Respuesta de la funcion inversa
x1_inv = subs(y1_inv,s,y1) %[output:813f7ade]
x2_inv = subs(y2_inv,s,y2) %[output:93a9d8b3]

figure %[output:5ea93be2]
subplot(2,1,1) %[output:5ea93be2]
fplot(x,T) %[output:5ea93be2]
hold on %[output:5ea93be2]
fplot(x1_inv,T,'--') %[output:5ea93be2]
hold off %[output:5ea93be2]
legend("x(t)","y^{-1}_1(y_1(x(t)))") %[output:5ea93be2]
subplot(2,1,2) %[output:5ea93be2]
fplot(x,T) %[output:5ea93be2]
hold on %[output:5ea93be2]
fplot(x2_inv,T,'--') %[output:5ea93be2]
hold off %[output:5ea93be2]
legend("x(t)","y^{-1}_2(y_2(x(t)))") %[output:5ea93be2]

%[text] El sistema $y\_1 \\left(t\\right)${"editStyle":"visual"} es invertible, mientras que $y\_2 \\left(t\\right)${"editStyle":"visual"} no lo es.
%[text] ![](text:image:7619)
%[text] 
%[text] **Estabilidad**
%[text] ![](text:image:0443)
clear 

syms s t 
x = cos(2*pi*t) %[output:3a2b80a7]
y1 = x^2 %[output:38f05f2d]
y2 = t*x %[output:40a2c175]

T = [-5 15];

figure %[output:1c153251]
subplot(2,1,1) %[output:1c153251]
fplot(x,T) %[output:1c153251]
legend("x(t)") %[output:1c153251]
subplot(2,1,2) %[output:1c153251]
fplot(y1,T) %[output:1c153251]
hold on %[output:1c153251]
fplot(y2,T,'--') %[output:1c153251]
hold off %[output:1c153251]
legend("y_1(t)","y_2(t)") %[output:1c153251]

%[text] El sistema $y\_1 \\left(t\\right)${"editStyle":"visual"} es **estable** porque, dada una entrada $x\\left(t\\right)${"editStyle":"visual"} acotada, la salida es **visiblemente acotada**; por otra parte $y\_2 \\left(t\\right)${"editStyle":"visual"}, bajo las mismas condiciones, visiblemente **diverge en un tiempo grande**, por lo que **es inestable**.
%[text] ![](text:image:59f2)
%%
%[text] ## Final
%[text] ![](text:image:28cb)
%[text] ![](text:image:585d)
clear
syms s t

x = cos(t)*(heaviside(t)-heaviside(t-10)) %[output:2622a531]

%a
x_d = subs(x,t,t+1) %[output:80d4bc33]

y = sqrt(x_d^2-2*(x_d*x)+x^2) %[output:4f7d6147]

%b
%La última etapa es una raiz cuadrada, entonces no es lineal.


%c
%Tralado en tiempo
t1 = -2;

T = [-5 15];
Y = [-4 4];

%Señal de entrada trasladada en tiempo
x_shifted = subs(x,t,t+t1) %[output:66bbef91]
%Salida del sistema alimentada con una señal trasladada en tiempo
y_original = subs(y,x,x_shifted) %[output:829ded07]
%Salida del sistema traladado en tiempo, alimentado con señal original
y_shifted = subs(y,t,t+1) %[output:78642b57]


figure %[output:32b48562]
subplot(2,1,1) %[output:32b48562]
fplot(x,T) %[output:32b48562]
hold on %[output:32b48562]
fplot(x_shifted,T,'--') %[output:32b48562]
hold off %[output:32b48562]
ylim(Y) %[output:32b48562]
legend("x(t)","x(t+t_1)") %[output:32b48562]
subplot(2,1,2) %[output:32b48562]
fplot(y_original,T) %[output:32b48562]
hold on %[output:32b48562]
fplot(y_shifted,T,'--') %[output:32b48562]
ylim(Y) %[output:32b48562]
hold off %[output:32b48562]
legend("y(x(t+t_1),t)","y(x(t),t+t_1)") %[output:32b48562]
%[text] Es invariable en el tiempo
%[text] ![](text:image:3384)

